import styled from 'styled-components';


export const Button = styled.button`
  outline: none;
  border: none;
  cursor: pointer;
  display: inline-flex;
  align-items: center;
  justify-content: center;
  height: 54px;
  padding: 0 32px;
  border-radius: 27px;
  background-color: 'rgba(86,102,246,1)';
  color: 'rgba(255,255,255,1)';

  font-family: Arial;
  font-weight: bold;
  font-size: 18px; line-height: 22px
  height: 44px;
    border-radius: 22px;
    padding: 0 24px;
    width:100%
  &:active {
    background-color: 'rgba(38,37,90,1)';
  }
`;

export const Card = styled.div`
  padding:  '24px' 
  background-color: 'rgba(255,255,255,1)';
  border-radius: 10px;

`;
